import React from 'react';
import './Avilable.css';
import Avilableitem from './Avilableitem';


function Avilable() {
  return (
    <div className='avilable-main'> 
        <span>Avilable</span>
        <div className='avilable-main-sub'>
          <Avilableitem/>
          <Avilableitem/>
          <Avilableitem/>
        </div>
    </div>
    
  )
}

export default Avilable
